import React from 'react'
import SearchBar from './SearchBar'
import WeatherDisplay from './WeatherDisplay'

class Display extends React.Component{
    constructor () {
        super()
        this.state = {
            temperature : '10',
            humidity: '0.65',
            precipType: 'rain',
            precipProbability: '0.9',
            wind: '5.59',
            summary: 'bad',
            lat: '10',
            lng: '11',

        }
    }


    update = ({lat,lng}) => {
        this.setState({
            lat,lng
        })
    }

    render () {
        return (
            <div>
                <SearchBar 
                update = {this.update} 
                />
                <WeatherDisplay 
                    data = {this.state}
                />
                 <p> {this.state.lat} </p>
            </div>

        )
    }
}

export default Display
